import "./styles.css";
import Header from "./Components/Header";
import SideheaderandContainer from "./Components/SideheaderandContainer";
import { useState } from "react";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

export default function App() {
  const [minimizeSideHeader, setMinimizeSideHeader] = useState(true);
  const toggleSideBar = () => {
    setMinimizeSideHeader(!minimizeSideHeader);
  };
  return (
    // <div className="App">
      <BrowserRouter>
      <Header toggleSideBar={toggleSideBar} />
      <SideheaderandContainer minimizeSideHeader={minimizeSideHeader} />
      {/* <React.Fragment> */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/search/:q" element={<Search />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    {/* </React.Fragment> */}
    </BrowserRouter>

    // </div>
  );
}
